// Android Extension
// very complicated and confusing from <GLES2/gl2ext.h>, which includes APPLE, NV, WIN32, ...

enum GLVersion {
  UNKNOWN = 'Unknown GL Version',
  GLES20 = 'OpenGL(ES) 2.0',
  GLES30 = 'OpenGL(ES) 3.0',
  GLES31 = 'OpenGL(ES) 3.1',
  GLES32 = 'OpenGL(ES) 3.2',

  GLES2_EXT_IOS = 'OpenGL(ES) 2.0 Extension(iOS)',
  GLES3_EXT_IOS = 'OpenGL(ES) 3.0 Extension(iOS)',
}

class GLEnumInfo {
  public version: GLVersion = GLVersion.UNKNOWN;
  public enumInDeximal: number = 0x0;
  public names: string[] = [];

  private _groups: any = {};

  constructor(version: GLVersion, enumInDex: number, names: string[]) {
    this.version = version;
    this.enumInDeximal = enumInDex;
    this.names = this.names.concat(names);

    this.rebuildGroups(version, names);
  }
  
  public getKeywords() {
    // Raycast doesn't support case insensitive searching
    // and fuzzy matching
    return this.names // original GL_XXX
      .concat(this.names.map(n => n.toLowerCase().substring(3)))  // easier for quick search
      .concat([`${this.enumInDeximal}`]); // original enum in deximal
  }

  public getTitle() {
    return `0x${this.enumInDeximal.toString(16).padStart(4, '0').toUpperCase()}`
  }

  public getOutput() {
    let output = '';
    Object.entries(this._groups).forEach((item: any) => {
      output += `### ${item[0]}\n${item[1].map((i: any) => '* ' + i).join('\n')}\n`;
    });
    return output;
  }

  public concatInfo(newInfo: GLEnumInfo) {
    this.names = this.names.concat(newInfo.names);
    this.rebuildGroups(newInfo.version, newInfo.names);
  }

  private rebuildGroups(newVer: GLVersion, newNames: string[]) {
    const names = this._groups[newVer];

    // version already exists
    if (names) {
      this._groups[newVer] = names.concat(newNames);
    } else {
      // create new version for group
      this._groups[newVer] = newNames;
    }
  }
}

export default function Command() {
  const all: any = {};

  function register(all: any, entry: any, version: GLVersion) {
    Object.entries(entry).forEach(item => {
      const key = item[0];
      const value = item[1] as string[];

      const newInfo = new GLEnumInfo(version, parseInt(key), value);

      const info = all[key] as GLEnumInfo;
      if (!info) {
        all[key] = newInfo;
      } else {
        info.concatInfo(newInfo);
      }
    });
  }

  register(all, es20, GLVersion.GLES20);
  register(all, es30, GLVersion.GLES30);
  register(all, es31, GLVersion.GLES31);
  register(all, es32, GLVersion.GLES32);

  register(all, es2ext_ios, GLVersion.GLES2_EXT_IOS);
  register(all, es3ext_ios, GLVersion.GLES3_EXT_IOS);

  // TODO: register other platform

  return (
    <List isShowingDetail>
      {Object.values(all).map((info: any) => (
        <List.Item
          key={ info.enumInDeximal }
          // dex or name
          keywords={ info.getKeywords() }
          // hex
          title={ info.getTitle() }
          detail={
            <List.Item.Detail markdown={ info.getOutput() }/>
          }
        />
      ))}
    </List>
  );
}